import{_ as e,a,b as o,c as r,d as l,e as s,f as n,g as h,h as p,i as d,j as c,k as u,l as m,m as g,n as b,o as f,p as P,q as k,r as w,s as x,t as M}from"./chunks/pixhawk_mini_port_main_out.U8yqhqVz.js";import{_ as t}from"./chunks/3dr_anti_vibration_mounting_foam.DSjkpZu8.js";import{_ as S,c as _,a8 as v,o as q}from"./chunks/framework.BDnHobkS.js";const X=JSON.parse('{"title":"Holybro Pixhawk Mini (Discontinued)","description":"","frontmatter":{},"headers":[],"relativePath":"ko/flight_controller/pixhawk_mini.md","filePath":"ko/flight_controller/pixhawk_mini.md"}'),C={name:"ko/flight_controller/pixhawk_mini.md"};function y(T,i,I,R,N,A){return q(),_("div",null,i[0]||(i[0]=[v('<h1 id="holybro-pixhawk-mini-discontinued" tabindex="-1">Holybro Pixhawk Mini (Discontinued) <a class="header-anchor" href="#holybro-pixhawk-mini-discontinued" aria-label="Permalink to &quot;Holybro Pixhawk Mini (Discontinued)&quot;">​</a></h1><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>PX4 does not manufacture this (or any) autopilot. Contact the <a href="https://holybro.com/" target="_blank" rel="noreferrer">manufacturer</a> for hardware support or compliance issues.</p></div><p>The Holybro <em>Pixhawk<sup>®</sup> Mini</em> autopilot is a next-generation evolution of the Pixhawk. 원래 Pixhawk의 약 1/3 크기이며 더 강력한 프로세서와 센서를 제공합니다.</p><p>Pixhawk 미니는 PX4 오픈 하드웨어 프로젝트를 기반으로하며 PX4 플라이트 스택에 최적화되었습니다.</p><p><img src="'+e+'" alt="Pixhawk Mini"></p><p>Wiring information is available <a href="#wiring">below</a>.</p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>This flight controller was designed by 3DR in collaboration with HobbyKing<sup>&amp;reg;</sup>. It was formerly known as the 3DR Pixhawk Mini.</p></div><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>This autopilot is <a href="./../flight_controller/autopilot_pixhawk_standard.html">supported</a> by the PX4 maintenance and test teams.</p></div><h2 id="사양" tabindex="-1">사양 <a class="header-anchor" href="#사양" aria-label="Permalink to &quot;사양&quot;">​</a></h2><p><strong>Processors:</strong></p><ul><li><strong>Main Processor:</strong> STM32F427 Rev 3</li><li><strong>IO Processor:</strong> STM32F103</li></ul><p><strong>Sensors:</strong></p><ul><li><strong>Accel/Gyro/Mag:</strong> MPU9250 <ul><li><a href="https://github.com/PX4/PX4-Autopilot/pull/7618" target="_blank" rel="noreferrer">deprecated</a> by the PX4 firmware</li></ul></li><li><strong>Accel/Gyro:</strong> ICM20608</li><li><strong>Barometer:</strong> MS5611</li></ul><p><strong>Voltage ratings:</strong></p><ul><li><strong>Power module output:</strong> 4.1~5.5V</li><li><strong>Max input voltage:</strong> 45V (10S LiPo)</li><li><strong>Max current sensing:</strong> 90A</li><li><strong>USB Power Input:</strong> 4.1\\`5.5V</li><li><strong>Servo Rail Input:</strong> 0~10V</li></ul><p><strong>Interfaces:</strong></p><ul><li>UART 직렬 포트 (GPS 용) 1개</li><li>Spektrum DSM/DSM2/DSM-X® Satellite 호환 입력</li><li>Futaba S BUS® 호환 RC 입력</li><li>PPM 합계 신호 RC 입력</li><li>I2C (디지털 센서용)</li><li>CAN (for digital motor control with compatible controllers)</li><li>ADC (for analog sensors)</li><li>마이크로 USB 소켓</li></ul><p><strong>Weight and dimensions:</strong></p><ul><li><strong>Dimensions:</strong> 38x43x12mm</li><li><strong>Weight:</strong> 15.8g</li></ul><p><strong>GPS module (supplied with kit):</strong></p><ul><li><strong>GNSS receiver:</strong> u-blox<sup>®</sup> Neo-M8N; compass HMC5983</li><li><strong>Weight:</strong> 22.4g</li><li><strong>Dimensions:</strong> 37x37x12mm</li></ul><h2 id="구매처" tabindex="-1">구매처 <a class="header-anchor" href="#구매처" aria-label="Permalink to &quot;구매처&quot;">​</a></h2><p>Discontinued.</p><h2 id="커넥터-할당" tabindex="-1">커넥터 할당 <a class="header-anchor" href="#커넥터-할당" aria-label="Permalink to &quot;커넥터 할당&quot;">​</a></h2><p><code>&lt;To be added&gt;</code></p><h2 id="특징" tabindex="-1">특징 <a class="header-anchor" href="#특징" aria-label="Permalink to &quot;특징&quot;">​</a></h2><p>Pixhawk 미니의 주요 특징은 다음과 같습니다.</p><ul><li>NuttX RTOS 실행 고급 32 비트 ARM Cortex® M4 프로세서</li><li>PWM/Servo 출력 8개</li><li>Multiple connectivity options for additional peripherals (UART, I2C, CAN)</li><li>중복 전원공급장치 및 자동 장애 조치</li><li>간편한 모터 활성화를 위한 통합 안전 스위치 및 옵션 외부 안전 버튼</li><li>다색 LED 표시기</li><li>통합 멀티톤 피에조 오디오 표시기</li><li>장기간 고속 로깅을 위한 microSD 카드</li><li>Easy-to-use Micro JST connectors</li></ul><p>The Pixhawk Mini is shipped with new <strong>GPS module</strong>:</p><ul><li>u-blox M8N 기반</li><li>최대 3 개의 GNSS(GPS, Galileo, GLONASS, BeiDou) 동시 수신</li><li>Industry leading -167 dBm navigation sensitivity</li><li>보안 및 무결성 보호</li><li>모든 위성 증강 시스템 지원</li><li>고급 재밍 및 스푸핑 감지</li><li>성능 및 비용 요구 사항을 충족하는 제품 변형</li></ul><h2 id="키트-패키지" tabindex="-1">키트 패키지 <a class="header-anchor" href="#키트-패키지" aria-label="Permalink to &quot;키트 패키지&quot;">​</a></h2><p>The <em>Pixhawk Mini</em> is shipped with the following contents:</p><table tabindex="0"><thead><tr><th>부품</th><th>이미지</th></tr></thead><tbody><tr><td>픽스호크 미니 자동항법장치</td><td><img src="'+a+'" alt="Pixhawk Mini"></td></tr><tr><td>GPS 모듈</td><td><img src="'+o+'" alt="Compass+GPS module"></td></tr><tr><td>쿼드 배전 보드</td><td><img src="'+r+'" alt="Quad Power Distribution Board"></td></tr><tr><td>8 채널 PWM 브레이크 아웃 보드</td><td><img src="'+l+'" alt="8 Channel PWM Breakout board"></td></tr><tr><td>4 핀 케이블 (I2C 용)</td><td><img src="'+s+'" alt="4-pin cable (for I2C)"></td></tr><tr><td>PPM/SBUS용 RC-in 케이블</td><td><img src="'+n+'" alt="RC-in cable for PPM/SBUS"></td></tr><tr><td>GPS 및 추가 I2C 장치용 6 ~ 6/4 ‘Y’ 어댑터</td><td><img src="'+h+'" alt="6 to 6/4 ‘Y’ adapter"></td></tr><tr><td>6 pin cable (2) (for power distribution board and for compass/gps)</td><td><img src="'+p+'" alt="6 pin cable"></td></tr><tr><td>레거시 원격 측정 라디오를 위한 6 핀 JST-DF13</td><td><img src="'+d+'" alt="6 pin JST to DF13"></td></tr><tr><td>안전 스위치</td><td><img src="'+c+'" alt="Safety switch"></td></tr><tr><td>8 채널 PWM 브레이크아웃 케이블</td><td><img src="'+u+'" alt="8 Channel PWM Breakout cable"></td></tr><tr><td>장착 폼</td><td><img src="'+t+'" alt="Mounting foam"></td></tr><tr><td>I2C 브레이크 아웃 보드? - not listed parts on handout</td><td>-</td></tr></tbody></table><h2 id="옵션-액세서리" tabindex="-1">옵션 액세서리 <a class="header-anchor" href="#옵션-액세서리" aria-label="Permalink to &quot;옵션 액세서리&quot;">​</a></h2><ul><li>Telemetry Radio Sets: 915 MHz (USA), 433 MHz (European)<div class="info custom-block"><p class="custom-block-title">INFO</p><p>When installing the 3DR telemetry radios, use the connectors that come with Pixhawk Mini, rather than those that come with the radios.</p></div></li></ul><p>:::</p><ul><li><p>3DR 10S 전원 모듈</p></li><li><p>WiFi 텔레메트리 라디오</p></li><li><p>디지털 대기속도 센서</p></li></ul><h2 id="호환성" tabindex="-1">호환성 <a class="header-anchor" href="#호환성" aria-label="Permalink to &quot;호환성&quot;">​</a></h2><h3 id="rc-라디오" tabindex="-1">RC 라디오 <a class="header-anchor" href="#rc-라디오" aria-label="Permalink to &quot;RC 라디오&quot;">​</a></h3><ul><li>PPM 출력 RC 수신기</li><li>Spektrum DSM RC 수신기</li><li>Futaba S BUS RC 수신기</li></ul><h3 id="esc" tabindex="-1">ESC <a class="header-anchor" href="#esc" aria-label="Permalink to &quot;ESC&quot;">​</a></h3><ul><li>All standard PWM input ESCs</li></ul><h2 id="커넥터-핀-할당-핀-배열" tabindex="-1">커넥터 핀 할당(핀 배열) <a class="header-anchor" href="#커넥터-핀-할당-핀-배열" aria-label="Permalink to &quot;커넥터 핀 할당(핀 배열)&quot;">​</a></h2><p><img src="'+m+'" alt="Pixhawk Mini - Connector Pinouts"></p><h2 id="제품-비교" tabindex="-1">제품 비교 <a class="header-anchor" href="#제품-비교" aria-label="Permalink to &quot;제품 비교&quot;">​</a></h2><h3 id="pixhawk-미니와-pixhawk-원본-비교" tabindex="-1">Pixhawk 미니와 Pixhawk(원본) 비교 <a class="header-anchor" href="#pixhawk-미니와-pixhawk-원본-비교" aria-label="Permalink to &quot;Pixhawk 미니와 Pixhawk(원본) 비교&quot;">​</a></h3><ul><li>크기의 1/3 - 50x81.5x15.5mm에서 38x43x12mm까지.</li><li>2MB 플래시 메모리를 최대한 활용하기위한 Rev 3 프로세서.</li><li>1차 및 2차 IMU MPU9250 및 ICM20608 모두 개선된 센서. The result is more stable, more reliable flight and navigation.</li><li>GPS + 나침반 모듈이 포함되어 있습니다. GLONASS를 지원하는 Neo M8N이 특징입니다. 나침반 HMC5983. 더 빠르고 강력한 GPS 잠금을 기대하십시오.</li><li>DF-13 대체 마이크로 JST 커넥터. 작업이 훨씬 용이합니다.</li><li>통합 피에조 스피커 및 안전 스위치.</li><li>기본적으로 포함된 PDB로 4S 배터리를 지원합니다.</li></ul><h3 id="pixhawk-미니와-pixfalcon-비교" tabindex="-1">Pixhawk 미니와 Pixfalcon 비교 <a class="header-anchor" href="#pixhawk-미니와-pixfalcon-비교" aria-label="Permalink to &quot;Pixhawk 미니와 Pixfalcon 비교&quot;">​</a></h3><ul><li>1차 및 2차 IMU MPU9250 및 ICM20608 모두 개선된 센서. 더 나은 진동 처리와 신뢰성을 기대하십시오.</li><li>UAVCAN 지원 CAN 인터페이스.</li><li>전력 PWM 출력이 필요한 비행기와 기타 차량용 8 채널 브레이크아웃 서보 레일이 포함되어 있습니다.</li><li>총 5 개의 I2C 연결용 I2C 브레이크아웃 보드를 포함합니다.</li><li>유사 크기.</li></ul><p>Pixhawk 미니는 ST Microelectronics®의 고급 프로세서 및 센서 기술과 NuttX 실시간 운영체제로 자율 주행 차량을 제어에 뛰어난 성능, 유연성 및 안정성을 제공합니다.</p><h2 id="알려진-문제" tabindex="-1">알려진 문제 <a class="header-anchor" href="#알려진-문제" aria-label="Permalink to &quot;알려진 문제&quot;">​</a></h2><ul><li>Some Pixhawk Minis have a <a href="https://github.com/PX4/PX4-Autopilot/issues/7327#issuecomment-317132917" target="_blank" rel="noreferrer">hardware defect</a> that makes the internal MPU9250 IMU unreliable. <ul><li>The problem is only present in older hardware revisions, because <a href="https://github.com/PX4/PX4-Autopilot/issues/7327#issuecomment-372393609" target="_blank" rel="noreferrer">it was fixed at some point by the manufacturer</a>.</li><li>특정 보드가 영향 여부를 확인하려면, 보드를 잠시 분리한 상태에서 전원을 켜고 PX4 명령 줄에서 mpu9250 드라이버를 시작하십시오. 보드가 영향을 받으면, 드라이버가 시작되지 않습니다.</li><li>The MPU9250 is <a href="https://github.com/PX4/PX4-Autopilot/pull/7618" target="_blank" rel="noreferrer">disabled by default</a> on the PX4 firmware.</li><li>결함이 존재하는 Pixhawk 미니는 실내에서도 외부 자력계 또는 부착된 GPS 없이는 보정되지 않습니다.</li><li>When using an external GPS, <a href="https://github.com/PX4/PX4-Autopilot/pull/7618#issuecomment-320270082" target="_blank" rel="noreferrer">this is not a problem</a> because the secondary ICM20608 provides the accelerometer and the gyro, while the external GPS provides the magnetometer.</li></ul></li></ul><p><a id="wiring"></a></p><h2 id="배선-개요" tabindex="-1">배선 개요 <a class="header-anchor" href="#배선-개요" aria-label="Permalink to &quot;배선 개요&quot;">​</a></h2><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>The <em>Pixhawk Mini</em> is no longer manufactured or available from 3DR.</p></div><p>This quick start guide shows how power the <a href="./../flight_controller/pixhawk_mini.html">Pixhawk Mini</a> and connect its most important peripherals.</p><h3 id="배선-개요-챠트" tabindex="-1">배선 개요 챠트 <a class="header-anchor" href="#배선-개요-챠트" aria-label="Permalink to &quot;배선 개요 챠트&quot;">​</a></h3><p>The image below shows standard <em>quadcopter</em> wiring using the <em>Pixhawk Mini Kit</em> and 3DR Telemetry Radios (along with ESC, motor, battery and a ground control station running on a phone). 다음 섹션에서 각 장치에 대해 자세히 설명합니다.</p><p><img src="'+g+'" alt="Pixhawk Mini Electronics Wiring for QAV250 (off frame)"></p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>The output wiring/powering is slightly different for other types of vehicles. VTOL, Plane, Copter에 대해서는 아래에서 자세히 설명합니다.</p></div><h3 id="콘트롤러-장착-및-장착-방향" tabindex="-1">콘트롤러 장착 및 장착 방향 <a class="header-anchor" href="#콘트롤러-장착-및-장착-방향" aria-label="Permalink to &quot;콘트롤러 장착 및 장착 방향&quot;">​</a></h3><p>The <em>Pixhawk Mini</em> should be mounted on the frame using vibration-damping foam pads (included in the kit). It should be positioned as close to your vehicle&#39;s center of gravity as possible, oriented top-side up with the arrow points towards the front of the vehicle.</p><p><img src="'+b+'" alt="Pixhawk Mini recommended orientation"></p><p><img src="'+t+'" alt="Mounting foam"></p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>If the controller cannot be mounted in the recommended/default orientation (e.g. due to space constraints) you will need to configure the autopilot software with the orientation that you actually used: <a href="./../config/flight_controller_orientation.html">Flight Controller Orientation</a>.</p></div><h3 id="gps와-나침반" tabindex="-1">GPS와 나침반 <a class="header-anchor" href="#gps와-나침반" aria-label="Permalink to &quot;GPS와 나침반&quot;">​</a></h3><p>Attach the 3DR GPS + Compass to the Pixhawk Mini&#39;s <strong>GPS&amp;I2C</strong> port (top right) using the supplied 6 pin cable. GPS/나침반은 차량 전명 방향 표시를 사용하여 가능한 한 다른 전자 장치에서 멀리 떨어진 프레임에 장착해야합니다 (나침반을 다른 전자 장치와 분리하면 간섭이 줄어듦).</p><p><img src="'+f+'" alt="Connecting compass/GPS to Pixhawk Mini"></p><p>참고 - 두 포트를 모두 표시하는 삽입 이미지? OR FRONT-FACING image of GPS&amp;I2C</p><p>The compass must be calibrated before it is first used: <a href="./../config/compass.html">Compass Calibration</a></p><h3 id="전원" tabindex="-1">전원 <a class="header-anchor" href="#전원" aria-label="Permalink to &quot;전원&quot;">​</a></h3><p>The image below shows typical power-supply wiring when using <em>Pixhawk Mini</em> in a Quadcopter. This uses the <em>Quad Power Distribution Board</em> that comes in the kit to supply both the Pixhawk Mini and the ESC/Motor from the battery (and can also power other accessories).</p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>The <em>Quad Power Distribution Board</em> includes a power module (PM) that is suitable for batteries &lt;= 4S. The <em>3DR 10S Power Module</em> (Discontinued) is recommended if you need more power.</p></div><p><img src="'+P+'" alt="Pixhawk Mini - Powering"></p><p>The <em>Pixhawk Mini</em> is powered through the <strong>PM</strong> port. 전원 모듈 시용시 포트를 통하여 아날로그 전압과 전류를 측정합니다.</p><p>배전반에서 최대 4 개의 ESC에 개별적으로 전원을 공급할 수 있습니다 (이 경우 하나만 연결되어 있음).</p><p>제어 신호는 MAIN OUT에서 나옵니다. In this case there is only one control channel, which is connected to the ESC via the <em>8 Channel PWM Breakout Board</em>.</p><p>Pixhawk 미니 출력 레일 (MAIN OUT)은 연결된 장치에 전원을 공급할 수 없습니다(그림과 같이 회로에 필요하지 않음). MAIN OUT이 전력을 끌어 오는 장치(예 : 비행기에서 사용되는 서보)에 연결된 차량의 경우 BEC (배터리 제거 회로)를 사용하여 레일에 전원을 공급하여야 합니다. The included breakout board allows one channel to provide power on the other outputs.</p><h3 id="무선-조종" tabindex="-1">무선 조종 <a class="header-anchor" href="#무선-조종" aria-label="Permalink to &quot;무선 조종&quot;">​</a></h3><p>Pixhawk 미니는 다양한 무선 수신기 모델을 지원합니다.</p><ul><li><p>Spektrum and DSM receivers connect to the <strong>SPKT/DSM</strong> input.</p><img src="'+k+'" width="350px" title="Pixhawk Mini - Radio port for Spektrum receivers"></li><li><p>PPM-SUM and S.BUS receivers connect to the <strong>RCIN</strong> port.</p><img src="'+w+'" width="350px" title="Pixhawk Mini - Radio port for PPM receivers"></li><li><p>PPM and PWM receivers that have an <em>individual wire for each channel</em> must connect to the <strong>RCIN</strong> port <em>via a PPM encoder</em> <a href="http://www.getfpv.com/radios/radio-accessories/holybro-ppm-encoder-module.html" target="_blank" rel="noreferrer">like this one</a> (PPM-Sum receivers use a single signal wire for all channels).</p></li></ul><p>For more information about selecting a radio system, receiver compatibility, and binding your transmitter/receiver pair, see: <a href="./../getting_started/rc_transmitter_receiver.html">Remote Control Transmitters &amp; Receivers</a>.</p><h3 id="안전-스위치-선택-사항" tabindex="-1">안전 스위치(선택 사항) <a class="header-anchor" href="#안전-스위치-선택-사항" aria-label="Permalink to &quot;안전 스위치(선택 사항)&quot;">​</a></h3><p>컨트롤러에는 자동조종장치가 이륙 준비가 되면 모터 활성화를 위한 안전 스위치가 있습니다. 특정 기체에서 이 스위치에 접근하기 어려운 경우에는 아래와 같이 외부 안전 버튼(선택 사항)을 장착할 수 있습니다.</p><p><img src="'+x+'" alt="Pixhawk Mini - Optional Switch"></p><h3 id="텔레메트리-무선통신" tabindex="-1">텔레메트리 무선통신 <a class="header-anchor" href="#텔레메트리-무선통신" aria-label="Permalink to &quot;텔레메트리 무선통신&quot;">​</a></h3><h3 id="모터" tabindex="-1">모터 <a class="header-anchor" href="#모터" aria-label="Permalink to &quot;모터&quot;">​</a></h3><p>The mappings between MAIN/AUX output ports and motor/servos for all supported air and ground frames are listed in the <a href="./../airframes/airframe_reference.html">Airframe Reference</a>.</p><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>The mapping is not consistent across frames (e.g. you can&#39;t rely on the throttle being on the same output for all plane frames). 가지고 있는 기체의 프레임에 대해 올바르게 모터를 제대로 연결하였는지 다시 한 번 확인하십시오.</p></div><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>If your frame is not listed in the reference then use a &quot;generic&quot; airframe of the correct type. ::: infos:</p><ul><li>The output rail must be separately powered, as discussed in the <a href="#power">Power</a> section above.</li><li>Pixhawk 미니는 QuadPlane VTOL 기체에 사용할 수 없습니다. 이는 QuadPlane에 9 개의 출력(메인 4 개, AUX 5 개)이 필요하고, Pixhawk 미니에는 8 개의 출력 (8 메인)만 필요하기 때문입니다.</li></ul><img src="'+M+'" width="350px" title="Pixhawk Mini - port for motors/servos"><h3 id="기타-주변-장치" tabindex="-1">기타 주변 장치 <a class="header-anchor" href="#기타-주변-장치" aria-label="Permalink to &quot;기타 주변 장치&quot;">​</a></h3><p>The wiring and configuration of other components is covered within the topics for individual <a href="./../peripherals/">peripherals</a>.</p><h3 id="설정" tabindex="-1">설정 <a class="header-anchor" href="#설정" aria-label="Permalink to &quot;설정&quot;">​</a></h3><p>General configuration information is covered in: <a href="./../config/">Autopilot Configuration</a>.</p><p>QuadPlane specific configuration is covered here: <a href="./../config_vtol/vtol_quad_configuration.html">QuadPlane VTOL Configuration</a></p><h2 id="펌웨어-빌드" tabindex="-1">펌웨어 빌드 <a class="header-anchor" href="#펌웨어-빌드" aria-label="Permalink to &quot;펌웨어 빌드&quot;">​</a></h2><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>대부분의 사용자들은 펌웨어를 빌드할 필요는 없습니다. It is pre-built and automatically installed by <em>QGroundControl</em> when appropriate hardware is connected.</p></div></div><p>To <a href="./../dev_setup/building_px4.html">build PX4</a> for this target:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>make px4_fmu-v3_default</span></span></code></pre></div><h2 id="디버그-포트" tabindex="-1">디버그 포트 <a class="header-anchor" href="#디버그-포트" aria-label="Permalink to &quot;디버그 포트&quot;">​</a></h2><p>This board does not have a debug port (i.e it does not have a port for accessing the <a href="./../debug/system_console.html">System Console</a> or <a href="./../debug/swd_debug.html">SWD interface</a>).</p><p>개발자는 SWD용 보드 테스트 패드와 STM32F4 (IC) TX와 RX에 와이어를 납땜하여 콘솔을 획득할 수 있습니다.</p>',95)]))}const B=S(C,[["render",y]]);export{X as __pageData,B as default};
